function textOverflowEllipsis(t){t.each(function(){var t=$(this),e=t.html(),h=t.clone();for(h.css({display:"none",position:"absolute",overflow:"visible"}).width(t.width()).height("auto"),t.after(h);e.length>0&&h.height()>t.height();)e=e.substr(0,e.length-1),h.html(e+"...");t.html(h.html()),h.remove()})}